import { Link } from "react-router-dom";
import axios from "axios";

export default class Home extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    if (this.props.loggedInStatus) {
      return (
        <div>
          <h3>Siema</h3>
        </div>
      );
    } else {
      this.props.history.push("/login");
    }
  }
}
